const Container = styled.div``;
const Wrapper = styled.div``
const Title = styled.h1``

function Cart() {
  return (
    <Container>
        <Navbar/>
        <Announcement/>
        <Wrapper>
            <Title>Your Bag</Title>
            <Top></Top>

        </Wrapper>

        <Footer/>
    </Container>
  )
}

export default Cart
